    def heapsort(nums):
        heap = nums
        for i in range(len(nums) - 1, -1, -1):
            heapify(heap, i)
        for i in range(len(nums) - 1, 0, -1):
            nums[i], nums[0] = nums[0], nums[i]
            heapify(heap, 0)
        return heap

    def heapify(heap, i):
        largest = i
        l = 2 * i + 1
        r = 2 * i + 2
        if l < len(heap) and heap[i] < heap[l]:
            largest = l
        if r < len(heap) and heap[largest] < heap[r]:
            largest = r
        if largest!= i:
            heap[i], heap[largest] = heap[largest], heap[i]
            heapify(heap, largest)

    n = int(stdin)
