    numberOfSquashed = 0
    squashed = [2, 2, 1]
    for i in range(rows):
        for j in range(cols):
            if grid[i][j] == '.':
                numberOfSquashed += 1
                for k in range(len(squashed)):
                    x, y = i, j
                    while True:
                        if x < 0 or y < 0 or x >= rows or y >= cols:
                            break
                        if grid[x][y] == squashed[k]:
                            x += squashed[k]
                            numberOfSquashed -= 1
                            break
                        elif grid[x][y] == '.':
                            x += squashed[k]
                        else:
                            x -= squashed[k]
                    visited[x][y] = True
    for i in range(rows):
        for j in range(cols):
            if visited[i][j] == False:
                numberOfSquashed += 1
    return str(numberOfSquashed)

