    for i in range(1, n + 1):
        if not visited[i]:
            visited[i] = True
            roads.append(i)
            stack = [i]
            while stack:
                vertex = stack.pop(0)
                for j in range(1, n + 1):
                    if table[vertex][j] and not visited[j]:
