    input = stdin.strip()
    input = input.replace(' ', '')

    # Hash map for lookup
    hashMap = {}

    # Create hashMap
    for i in range(97, 123):
        hashMap[chr(i)] = chr(i - 1)

    # Reduce string
    reduced = ''
    for char in input:
        reduced += hashMap[char]

    # Check if input is a palindrome
    if input == reduced:
        return 0

    # Check if input is a Peragram
    if input == reduced[::-1]:
        return len(input)

    # Recursion
    minCount = float('inf')
    if len(reduced) >= 2:
        for i in range(1, len(reduced)):
            # No need to remove any character
            if i % 2 == 0:
                continue

            # Remove the i'th character
            reduced2 = reduced[:i] + reduced[i + 1:]

            # Recurse if it is a palindrome
            if reduced2 == reduced2[::-1]:
                minCount = min(minCount, i)

    # return minimum number of characters needed to make the input a palindrome
    return minCount if minCount!= float('inf') else len(input)

