def solution(stdin: str) -> str:
    rows, columns = (int(r) for r in stdin.split())

    image = [[c for c in stdin]]
    for i in range(1, rows):
        image.append(stdin.split()[i * columns:(i + 1) * columns])

    def get_neighbours(x, y):
        x1, y1 = x, y
        directions = [(1, 0), (-1, 0), (0, 1), (0, -1)]
        for dx, dy in directions:
            nx, ny = x1 + dx, y1 + dy
            while 0 <= nx < columns and 0 <= ny < rows and image[ny][nx]!= 'C':
                yield nx, ny
                nx += dx
                ny += dy
        return

    def bfs(x, y):
        q = deque()
        q.append((x, y))
        while q:
            x, y = q.popleft()
            for nx, ny in get_neighbours(x, y):
                if image[ny][nx] == 'L':
                    image[ny][nx] = 'W'
                    q.append((nx, ny))
        return

    def is_island_safe(x, y):
        if 0 <= x < columns and 0 <= y < rows and image[y][x] == 'L':
            return True
        return False

    def is_island_flooded(x, y):
        if 0 <= x < columns and 0 <= y < rows and image[y][x] == 'W':
            return True
        return False

    def flood_island(x, y):
        if not is_island_safe(x, y):
            return False
        if is_island_flooded(x, y):
            return True
        image[y][x] = 'W'
        q = deque()
        q.append((x, y))
        while q:
            x, y = q.popleft()
            for nx, ny in get_neighbours(x, y):
                if is_island_safe(nx, ny) and is_island_flooded(nx, ny) is False:
                    q.append((nx, ny))
        return True

    def minimum_islands():
        min_islands = columns * rows
        for y in range(rows):
            for x in range(columns):
                if image[y][x] == 'L' and flood_island(x, y) is True:
                    min_islands -= 1
        return min_islands

    return minimum_islands()

